import { createRouter, createWebHistory, RouteRecordRaw } from 'vue-router'

const router = [{
        path:'/',
        component:()=>import('./page/HomePage.vue'),
        children:[
            {
                path:'/my',
                component:()=>import('./page/MyDetail.vue')
            }
        ]
}]

export default createRouter({
    routes:router,
    history:createWebHistory()
})
